IF OBJECT_ID('dbo.proc_transform_332', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_332;
GO
CREATE PROCEDURE dbo.proc_transform_332
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_332
    SET payload = LEFT(payload, 1000) + N'|V4-332|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_332;
END
